import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input field to be visible
    await page.waitForSelector('#eventSearchInput');

    // Click on the search input field to focus it
    await page.click('#eventSearchInput');

    // Take a screenshot after focusing the input
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_focused_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_focused_search_input.png'));

    return {
      success: true,
      action: "Focused on the search input field",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

